import React from "react";
import styled from "styled-components";

const StyledButton = styled.button`
  background-color: #662d91;
  color: #fff;
  float: right;
  border-radius: 15px;
  &:hover {
    cursor: pointer;
  }
`;

const Button = () => {
  return <StyledButton></StyledButton>;
};

export default Button;
